IF OBJECT_ID('dbo.staging_table_33', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.staging_table_33 (
        id INT IDENTITY(1,1) PRIMARY KEY,
        payload NVARCHAR(MAX),
        created_on DATETIME2 DEFAULT SYSUTCDATETIME()
    );
END
GO

GO

GO

GO

GO

GO

IF OBJECT_ID('dbo.proc_transform_33', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_33;
GO
CREATE PROCEDURE dbo.proc_transform_33
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_33
    SET payload = LEFT(payload, 1000) + N'|V4-33|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_33;
END
GO
IF OBJECT_ID('dbo.audit_v4_33', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_33 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_33;
GO

CREATE INDEX IDX_staging_33_payload ON dbo.staging_table_33 (id);
GO
EXEC sp_updatestats;
GO

